<a tabindex="0" class="btn btn-lg btn-danger" role="button" data-toggle="popover" data-trigger="focus" title="Dismissible popover" data-content="And here's some amazing content. It's very engaging. Right? ">Dismissible popover
  <br></a>
<!-- Button trigger modal -->

<!-- Modal -->
<div class="modal fade" id="myModal" tabindex="-1" role="dialog" aria-labelledby="myModalLabel">
  <div class="modal-dialog" role="document">
    <div class="modal-content">
      <div class="modal-header">
        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
        <h2 class="modal-title" id="myModalLabel" ng-bind-html="question.question"></h2>
      </div>
      <div class="modal-body" ng-show="i == 0">
        <div class="embed-responsive embed-responsive-4by3">
          <iframe class="embed-responsive-item" src="//www.youtube.com/embed/ePbKGoIGAXY"></iframe>
        </div>
      </div>

      <div class="modal-body" ng-show="i == 1">
        <div class="row">
          <img src="../img/Lenses.png" alt="" style="width: 50%; height: 50%;"/>
        </div>
        <br>
        <div class="col-md-offset-1 col-md-11">
          <button ng-repeat="answers in question.answer" ng-click="checkreponse(id,$index)" type="button" class="btn block-answer col-md-5">
            {{answers}}
          </button>
        </div>
      </div>
      <div class="modal-body" ng-show="i == 2">
        <div class="row">
          <img ng-src="'../img/'+ question.photo" alt="" style="width: 50%; height: 50%;"/>
        </div>

        <div class="col-md-offset-1 col-md-10">
          <div class="answer">
            <div ng-show="filter" class="bravo">
              <h1>Bravo</h1>
              <h4>+ 10 points</h4>
            </div>
            <div ng-show="!filter" class="faux">
              <h1>Faux</h1>

            </div>
          </div>
          <h4>Mesurer la concentration de glucose dans les larmes</h4>
        </div>
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-default" data-dismiss="modal" ng-click="i = 0">Close</button>
        <button type="button" class="btn btn-primary" ng-show="i > 0" ng-click="i = i - 1">Prcdent</button>

        <button type="button" class="btn btn-primary" ng-click="i = i + 1">Suivant</button>
      </div>
    </div>
  </div>
</div>

<script type="text/javascript">
  $(function() {
    $('[data-toggle="popover"]').popover()
  });
</script>
<script type="text/javascript">
  $(function() {
    $('[data-toggle="tooltip"]').tooltip()
  })
</script>
